import { StatusBar } from 'expo-status-bar';
import React from 'react';


import { StyleSheet, Text, View, ImageBackground, TextInput } from 'react-native';


const [text, onChangeText] = React.useState(null);

export default function LoginPage() {
    return (
        <View style={styles.container}>
            <ImageBackground style={{ width: 414, height: 900, alignItems: 'center',justifyContent: "center" }} source={require('../assets/Images/loginPage.png')}></ImageBackground>
        
            <TextInput style={styles.inputone}  onChangeText={onChangeText} value={text} placeholder="email" placeholderTextColor="grey"/>
        
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        marginTop:48,
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
        position: "relative",
       
    },
    inputone: {
        paddingLeft:10,
        display:'flex',
        marginTop:-130,
        width: 268,
        height: 50,
        borderWidth: 1,
        backgroundColor: '#F8F8F8',
        borderRadius: 50,
        borderColor: "white",
        shadowColor: "#000",
        shadowOffset: {
            width: 0,
            height: 2,
        },
        shadowOpacity: 0.30,
        shadowRadius: 2.65,
        elevation: 5, 
      },
});
